pragma solidity ^0.4.24;

import "./Assets.sol";

contract AssetsRelay is Assets {
    address public owner;
    uint public createdAt;
    Assets public assetsContract;

    modifier restrictToOwner {
        if (tx.origin == owner) _;
    }

    constructor(Assets aContract) public {
        assetsContract = aContract;
        owner = msg.sender;
        createdAt = now;
    }

    function setContract(Assets aContract) public restrictToOwner {
        assetsContract = aContract;
    }

    function setPublisherLevel(address[] publicKeys, int level) external {
        assetsContract.setPublisherLevel(publicKeys, level);
    }

    function disablePublisher(address[] publicKeys) external {
        assetsContract.disablePublisher(publicKeys);
    }

    function getPublishers() external view returns (address[]) {
        return assetsContract.getPublishers();
    }

    function getPublisherByAddress(address publicKey) external view returns (address, int, uint) {
        return assetsContract.getPublisherByAddress(publicKey);
    }

    function sign(string hash, int status) external {
        assetsContract.sign(hash, status);
    }

    function verify(string hash) external view returns (address, int, int, uint) {
        return assetsContract.verify(hash);
    }

    function verifyByIndex(string hash, uint assetIndex) external view returns (address, int, int, uint) {
        return assetsContract.verifyByIndex(hash, assetIndex);
    }

    function getAssetCount() external view returns (uint) {
        return assetsContract.getAssetCount();
    }

    function getAssetCountForHash(string hash) external view returns (uint) {
        return assetsContract.getAssetCountForHash(hash);
    }
}
